import React from "react";

export default function ProjectDisp(props) {
  return (
    <div className="projectDispBox">
      <img src={props.image} alt={props.alt}></img>
      <h3>{props.title}</h3>
      <p>{props.description}</p>
      <p>{props.tools}</p>
      <a href={props.repo}>Repo</a>
      <a href={props.site}>App</a>
    </div>
  );
}
